CREATE PROCEDURE `add_sensor`(
	IN `sensor_id` bigint,
    IN `type` varchar(20),
    IN `buttonPress` tinyint,
    IN `status` json ,
	IN `battery_voltage` float ,
	IN `condition` varchar(10) ,
	IN `temperature` float ,
	IN `humidity` float ,
	IN `rssi` int ,
	IN `time` timestamp ,
	IN `gateway_data_id` bigint ,
	IN `gateway_id` bigint
)
BEGIN
	set @sensor_id = null;
    select sensor_id into @sensor_id from sensor where sensor.sensor_id = `sensor_id`;
    if(isNUll(@sensor_id)) then 
		insert into sensor value(`sensor_id`, `type`,`battery_voltage`,`condition`,`temperature`,`humidity`,`rssi`,`time`,`buttonPress`);
    else
		update sensor set
			`type`=`type`,
			`battery_voltage`=`battery_voltage`,
			`condition`=`condition`,
			`temperature`=`temperature`,
			`humidity`=`humidity`,
			`rssi`=`rssi`,
			`time`=`time`,
            `buttonPress`=`buttonPress`
            where `sensor_id`=sensor.`sensor_id`;
    end if;
    
    insert into sensor_data (`status`,`battery_voltage`,`condition`,`temperature`,`humidity`,`rssi`,`time`,`sensor_id`,`gateway_data_id`,`gateway_id`, `buttonPress`)
    value(`status`,`battery_voltage`,`condition`,`temperature`,`humidity`,`rssi`,`time`,`sensor_id`,`gateway_data_id`,`gateway_id`, `buttonPress`);
END ;;
DELIMITER ;


